import "./index.css"
import Gamepad from "./lib/gamepad"
import WebGL from ".l/lib/webgl"
import Assets from "./assets"

console.log("Gamepad.isConnected=", Gamepad.isConnected);
WebGL.fetchAssets(Assets).then(start);


function start(assets) {
    console.info("assets=", assets);
}
